import "./Header.css";
import github from "./GitHubLogo.png";
import linkedin from "./LinkedInLogo.png";

function Header() 
{
  return (
      <header className="header">
        <img href="https://github.com/graceelias" src={github} className="github"/>
          Grace Elias
        <img href="https://www.linkedin.com/in/grace-elias-87b165233/" src={linkedin} className="github"/>
      </header> 
  );
}


export default Header;
